(ns editor.sid
  (:require [clojure.string :as string])
  (:import (java.lang.Math)))

; http://partow.net/programming/hashfunctions/index.html#StringHashing

(def *base* 65521)

;; "*nmax* is the larges n such that
;; (< ((fn [n]
;;       (+ (* 255 n (inc n) 1/2) (* (inc n) (inc *base*)))) 5552)  (long (dec (Math/pow 2 32))))
;; "
(def *nmax* 5552)

(def *block-size* 16)

(defn- string->int-seq [str]
  (map int (string/lower-case str)))

(defn- do-block [q acc]
  (let [[s1 s2] acc]
    (if (empty? q)
      acc
      (let [x (+ s1 (first q))]
        (recur (next q) [x (+ x s2)])))))

(defn- do-region [q acc]
  (if (empty? q)
      acc
      (recur (next q) (do-block (first q) acc))))

(defn- mod-sum [pair]
  (if-let [[s1 s2] pair]
    [(mod s1 *base*) (mod s2 *base*)]))

(defn gen-sid [str]
  "Generate CRC32 value of str"
  (let [region-seq (partition-all *nmax* (string->int-seq str))]
    (loop [q region-seq, acc [0 0]]
      (if (empty? q)
        (let [[s1 s2] acc]
          (bit-or (bit-and 0xFFFFFFFF (bit-shift-left s2 *block-size*)) s1))
        (recur (next q) (mod-sum (do-region (partition-all *block-size* (first q)) acc)))))))

(defn- random-str [len]
  (apply str (take len (filter #(some #{%}
                                      "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789_")
                               (repeatedly (fn []
                                     (char (+ (int \!) (rand-int (- (int \~) (int \!)))))))))))

